[{"location":"#CountTimeSeries.jl-Documentation","page":"CountTimeSeries.jl Documentation","title":"CountTimeSeries.jl Documentation","text":"","category":"section"},{"location":"","page":"CountTimeSeries.jl Documentation","title":"CountTimeSeries.jl Documentation","text":"","category":"page"},{"location":"#Getting-Started","page":"CountTimeSeries.jl Documentation","title":"Getting Started","text":"","category":"section"},{"location":"","page":"CountTimeSeries.jl Documentation","title":"CountTimeSeries.jl Documentation","text":"Text","category":"page"},{"location":"#Types-and-Structs","page":"CountTimeSeries.jl Documentation","title":"Types and Structs","text":"","category":"section"},{"location":"","page":"CountTimeSeries.jl Documentation","title":"CountTimeSeries.jl Documentation","text":"CountModel","category":"page"},{"location":"#CountTimeSeries.CountModel","page":"CountTimeSeries.jl Documentation","title":"CountTimeSeries.CountModel","text":"Model(model, distr, link, pastObs,\n      pastMean, X, external, zi)\n\nStructure to specify count data models with subtypes for more specific models.\n\nmodel: \"INARMA\" or \"INGARCH\"\ndistr: \"Poisson\" or \"Negative Binomial\" (Vector for INARMA)\nlink: Vector of length two, \"Linear\" or \"Log\" (Vector for INARMA)\npastObs: Lags considered in autoregressive part\npastMean: Lags considered in MA/past conditional mean part\nX: Matrix of regressors (row-wise)\nexternal: Indicator(s) if regressors enter externally\nzi: Indicator, zero inflation Y/N\n\nFor details, see Documentation\n\n\n\n\n\n","category":"type"},{"location":"","page":"CountTimeSeries.jl Documentation","title":"CountTimeSeries.jl Documentation","text":"INGARCH","category":"page"},{"location":"#Functions","page":"CountTimeSeries.jl Documentation","title":"Functions","text":"","category":"section"},{"location":"","page":"CountTimeSeries.jl Documentation","title":"CountTimeSeries.jl Documentation","text":"Model(;model = \"INGARCH\", distr = \"Poisson\", link = \"Linear\",\r\n      pastObs = [], pastMean = [], X = [],\r\n      external = [], zi = false)","category":"page"},{"location":"#CountTimeSeries.Model-Tuple{}","page":"CountTimeSeries.jl Documentation","title":"CountTimeSeries.Model","text":"Model(;model = \"INGARCH\", distr = \"Poisson\", link = \"Linear\",\n      pastObs = [], pastMean = [], X = [],\n      external = [], zi = false)\n\nWrapper function to define count data models.\n\nInput defined as in ModelTypes. Default setting is an an IID Poisson process without regressors or zero inflation.\n\nExamples\n\nModel(pastObs = 1:2, pastMean = 1) # INGARCH(2, 1)\nModel(pastObs = [1, 2], distr = \"NegativeBinomial\") # NB-INARCH(2)\nModel(model = \"INARMA\", pastMean = 1, zi = true) # Zero inflated INMA(1)\n\nFor details, see Documentation\n\n\n\n\n\n","category":"method"},{"location":"#Index","page":"CountTimeSeries.jl Documentation","title":"Index","text":"","category":"section"},{"location":"","page":"CountTimeSeries.jl Documentation","title":"CountTimeSeries.jl Documentation","text":"","category":"page"}]
